import React from 'react';

function Publications() {
  return (
    <div>
      <h1>Publications</h1>
      <ul>
        <li>Publication 1</li>
        <li>Publication 2</li>
        <li>Publication 3</li>
      </ul>
    </div>
  );
}

export default Publications;
